'use client';
'use strict';

var jsxRuntime = require('react/jsx-runtime');
var cl = require('clsx/lite');
var react = require('react');

const ComboboxOptionDescription = react.forwardRef(({ children, className, ...rest }, ref) => {
    return (jsxRuntime.jsx("span", { className: cl('ds-combobox__option__description', className), ref: ref, ...rest, children: children }));
});
ComboboxOptionDescription.displayName = 'ComboboxOptionDescription';

module.exports = ComboboxOptionDescription;
